import React from "react";

//styles

import styles from "../styles";

//items list
import produts from "../produts";

const ProdutList = () => {
  const itemsList = produts.map((produt) => (
    <div style={styles.photmar} key={produt.id}>
      <img src={produt.image} alt={produt.name} style={styles.prodimag} />
      <p style={styles.text}>{produt.name}</p>
      <p style={styles.text}> {produt.price} KD</p>
    </div>
  ));
  return <div style={styles.list}>{itemsList}</div>;
};

export default ProdutList;
